import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Landing from './pages/landing/Landing'; // Import the new landing page
import JoinRoom from './pages/JoinRoom/JoinRoom'; // Your existing join page
import Room from './pages/Room/Room';
import SocketWrapper from './components/SocketWrapper';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* The root path '/' now shows the new Landing page */}
        <Route path="/" element={<Landing />} />

        {/* The Join/Create Room page is now at '/join' */}
        <Route path="/join" element={<JoinRoom />} />

        {/* The editor room route remains the same */}
        <Route
          path="/room/:roomId"
          element={
            <SocketWrapper>
              <Room />
            </SocketWrapper>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
